import com.eviware.soapui.support.XmlHolder

def addReq=testRunner.testCase.testSuite.testCases["add"].testSteps["add-001"].getPropertyValue("Request")

def id=testRunner.testCase.testSuite.testCases["get"].getPropertyValue("id")

def dept=testRunner.testCase.getPropertyValue("dept")

def XmlAdd=new XmlHolder(addReq)

XmlAdd.setNodeValue("//typ:addEmployee/typ:id","34")
XmlAdd.setNodeValue("//typ:addEmployee/typ:name","vi1234544")
XmlAdd.setNodeValue("//typ:addEmployee/typ:Department",dept)
XmlAdd.setNodeValue("//typ:addEmployee/typ:age","25")

def newAddXml=XmlAdd.getXml();
testRunner.testCase.testSuite.testCases["add"].testSteps["add-001"].setPropertyValue("Request",newAddXml)



import com.eviware.soapui.impl.wsdl.testcase.WsdlTestRunContext

def tsAdd=testRunner.testCase.testSuite.testCases["add"].testSteps["add-001"]


def contextAdd=new WsdlTestRunContext(tsAdd)

tsAdd.run(testRunner,contextAdd)




def vResponse = testRunner.testCase.testSuite.testCases["add"].testSteps["add-001"].getPropertyValue("Response")
